import React from "react";
// import { useState,useEffect } from "react";
import "./tweet.css";
import Tweet from "./tweet.json"
function Twitter() {
    console.log(Tweet);
    return (
        <div className="flex-container">
            <div>
                <h3>Twitter Scams.....</h3>
            </div>
            <div className="cards-tweets">
                <div className="cardtweets">
                    <div className="details">
                        <ul>
                  <li><p> id:{Tweet && Tweet[0].id}</p></li> 
                   <p> name:{Tweet && Tweet[0].name}</p>
                   <p> tweet:{Tweet && Tweet[0].tweet}</p>
                {/* <h3>Twitter</h3> */}
                </ul>
                </div>
                </div>

                <div className="cardtweets">
                <h3>Twitter</h3>
                </div>
            </div>
            </div>
    );
}

export default Twitter;
